import React from "react";
import Container from "react-bootstrap/Container";
import Nav from "react-bootstrap/Nav";
import Navbar from "react-bootstrap/Navbar";

function Navbar1() {
  return (
    <>
       <div style={{display:"flex", height:"90px",gap:"36px",paddingTop:"24px",paddingLeft:"16px", justifyContent:"space-between"}} >
    <div style={{ display:"flex", height:"90px"}}>
        <div style={{weidth:"170px", gap: "36px" }}>
          <img src="./img/10.png" alt="icon" style={{height:"58px"}}/>
        </div>
        <div>
          <ul style={{ font:"Montserrat",fontSize: "16px", fontWeight: "500", color: "#333333" , display:"flex",gap:"36px", listStyleType:"none"}} >
            <li className="ho"> <a href="">Home</a></li>
            <li className="ho">My Clients</li>
            <li className="ho">Transform for Job Description</li>
            <li className="ho">Job Description Matching</li>
            <li className="ho">My Purchase</li>
          </ul>
      </div>
      <div style={{display:"flex",paddingLeft:"188px",gap:"8px"}}>
        <div>
          <img src="./img/1.png.png" alt="" style={{height:"40px"}}/>
        </div> 
        <div className="ho" style={{fontSize:"14px",fontWeight:"600",paddingTop:"12px"}}>Mark Hamilton</div>
      </div>
    </div>
    </div>
    </>
  );
}

export default Navbar1;
